// Template from https://github.com/kth-competitive-programming/kactl/blob/master/content/contest/template.cpp
#define rep(i, a, b) for(int (i) = a; (i) < (b); ++(i))
#define all(x) begin(x), end(x)
#define sz(x) (int)(x).size()
typedef long long ll;
typedef pair<int, int> pii;
typedef vector<int> vi;
#define double long double
#define order_set tree<int, null_type, less<>, rb_tree_tag, tree_order_statistics_node_update>
mt19937 rng(chrono::steady_clock::now().time_since_epoch().count());
typedef vector<vector<ll>> matrix;

const int N = 1e5 + 5;
int n, m, a[N], l[N], r[N], dp[N];

int solveTestCase() {
    cin >> n >> m;
    rep (i, 0, m) cin >> a[i], a[i]--;

    if (n == 1)
        return cout << "0", 0;

    map<int, int> next;
    for (int i = m - 1; i >= 0; i--) {
        if (next.find(a[i] - i - 1) != next.end())
            dp[i] = dp[next[a[i] - i - 1]] + 1;
        else
            dp[i] = 1;
        next[a[i] - i] = i;
    }

    rep (i, 0, n) {
        if (next.find(i + 1) != next.end())
            r[i] = i + m + 1 - dp[next[i + 1]];
        else
            r[i] = i + m + 1;
        r[i] = min(r[i], n - 1);
    }

    next.clear();
    for (int i = m - 1; i >= 0; i--) {
        if (next.find(a[i] + i + 1) != next.end())
            dp[i] = dp[next[a[i] + i + 1]] + 1;
        else
            dp[i] = 1;
        next[a[i] + i] = i;
    }

    rep (i, 0, n) {
        if (next.find(i - 1) != next.end())
            l[i] = i - m - 1 + dp[next[i - 1]];
        else
            l[i] = i - m - 1;
        l[i] = max(l[i], 0);
    }

    ll ans = 0;
    rep (i, 0, n)
        ans += r[i] - l[i] + 1;
    cout << ans;
}

signed main() {
    ios::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);
    cout.precision(18);

    int t = 1;
    // cin >> t;
    while (t--)
        solveTestCase();
}
